import '../App.css';
import React, { useEffect, useState, useRef } from "react";
import OneToOne from "../components/OneToOne";


function Reports(props) {
    const downloadData = () => {
        // 다운로드 기능 구현
    };

    const [startTime, setStartTime] = useState("");
    const [finishTime, setFinishTime] = useState("");

    const carName = "현대 아반떼";
    const VIN = "F876F7623G234"

    const [OBDData, setOBDData] = useState

    const handleStartTimeChange = (e) => {
        setStartTime(e.target.value);
    };

    const handleFinishTimeChange = (e) => {
        setFinishTime(e.target.value);
    };

    useEffect(() => {
        // 서버에 데이터 요청하는 코드
    }, []);

    const mapRef = useRef();
    const lat = 37.3595704;
    const lng = 127.105399;

    useEffect(() => {
        const { naver } = window;
        if(mapRef.current && naver) {
            const location = new naver.maps.LatLng(lat, lng);
            const map = new naver.maps.Map(mapRef.current, {
                center: location,
                zoom: 17,
            });
            new naver.maps.Marker({
                position: location,
                map,
            });
        }
    }, []);


    return  (
        <div className="Reports">
            <div className="wrap">
                <div className="head">
                    <div className="title">
                        Reports
                    </div>
                    <div className="download-button" onclick={downloadData}>
                        <i class="fa-solid fa-download"/>
                        <div className="download">Download</div>
                    </div>
                </div>
                <hr color="#E5E5E5"/>
                <div className="time-setting">
                    <div className="title">TIME RANGE :</div>
                    <div className="from">FROM</div>
                    <div className="start-time">
                        <input type="datetime-local" id="start" value={startTime} onChange={handleStartTimeChange}/>
                    </div>
                    <div className="to">TO</div>
                    <div className="finish-time">
                        <input type="datetime-local" id="finish" value={finishTime} onChange={handleFinishTimeChange}/>
                    </div>
                </div>
                <div className="body">
                    <div className="left">
                        <div className="car-photo">
                            <img src={props.photo} alt="차량 이미지"/>
                        </div>
                        <div className="car-info">
                            <ul>
                                <li>차량 이름: {carName}</li>
                                <li>VIN: {VIN}</li>
                                <li>대충 차량의 기타 정보들</li>
                            </ul>
                        </div>
                        <div className="car-status-left">
                            <OneToOne className="OneToOne" title="SPEED" value="76" unit="km.h" fontSize="24px"/>
                            <OneToOne className="OneToOne" title="RPM" value="76" unit="km.h" fontSize="24px"/>
                            <OneToOne className="OneToOne" title="THROTTLE POSITION" value="76" unit="km.h" fontSize="16px"/>
                            <OneToOne className="OneToOne" title="RPM" value="76" unit="km.h" fontSize="24px"/>
                        </div>
                    </div>
                    <div className="right">
                        <div className="map">
                            <div className="naver-map" ref={mapRef}></div>
                        </div>
                        <div className="car-status-right">
                            <OneToOne className="OneToOne" title="RPM" value="76.2" unit="km.h" fontSize="24px"/>
                            <OneToOne className="OneToOne" title="RPM" value="76" unit="km.h" fontSize="24px"/>
                            <OneToOne className="OneToOne" title="RPM" value="76" unit="km.h" fontSize="24px"/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Reports;
